window.bookSummaryJSON = "<p>She hates me. But no other wolf will protect her like I can....</p> <p>I swear this is the last time I come to Kira’s rescue. Not that she’s ever realized it, because my best friend’s little sister is too busy hating me to notice.</p> <p>And while she may be infuriating, temperamental, and unpredictable, my wolf felt her pain when her mate rejected her publicly. </p> <p>Now, she’s determined to claw back her reputation by taking part in <i>The Reject Project</i>, an infamously dangerous TV show featuring irresistible bachelors and rejected mates. </p> <p>I’m not about to stand by and watch her being thrown to the wolves, and I’ve got to admit, the look on her face when she saw I was among the eligible bachelors was priceless. So is watching her pretend to be in love with me.</p> <p>Except when the competition turns nasty, my fierce protector wolf isn’t playing games anymore. This time, he intends to play for keeps....</p>"; 
